@theordinary heard a lot of mixed reviews, but honestly if you use it diligently it truly works. I used it on my underarms and elbows and I’m certainly seeing a clear difference. It can give you a chemical burn if you over do it so definitely take care of that. 
@maybelline this might just be the most overhyped foundation of 2024. Where is the lumi effect? And let’s not even get into the horrendous shade range. I wonder when brands will actually start launching all the shades in one go!
@reachedmars love this foundation. It was all over my youtube and I honestly get the hype. I picked a dark shade earlier but now that I got a better match, I’m so loving it! It does oxidise so keep that in mind.
@lorealparis this shampoo has been everywhere since it launched. I used almost all of it. It feels really hood in the first few washes but after that you can feel your hair not being that clean. I actually found my hair getting oily faster. I’m still not sure if it was this shampoo, but since the rest of the things in my routine were the same, I’m guessing it was this.
@thefaceshopindia_official been a while since these went viral but omg I love these. I mean they’re just so effective. They don’t excessively dry out the skin but still help calming down a pimple. The best way to use it is when you feel a pimple coming and it will make sure it gets eliminated!
@elfcosmetics both the wands have been working great. I use them once my entire makeup is done to add a boost of shine and life. They have a metallic finish and last really long. You can get that wet effect with these two.  The foundation has my heart. Even though the shade is wrong as I bought it when I was tanned, but the formulation is so good, it’s very lightweight. It looks super duper natural and still lasts long. It has decent coverage, and you can build it up to an almost full coverage. And the tube packaging is also really easy to travel with. It’s been awhile since I’ve found a foundation that is thin, but still has good coverage for the average pigmented Indian skin tone.
